import React from 'react';
import { Container, Row, Col } from 'react-grid-system';
import {work} from '../components/work';
import {spacer1, spacer2, spacer3, spacer4} from '../components/constants';

const workList= work.map(tile=>(
    <Col md={6} style={{marginTop: spacer3}}>
        <h2>{tile.image}</h2>
        <a href="#">
        <img src={tile.image} alt={tile.company} />
        </a>
        <h2 style={{marginTop: spacer2}}> {tile.position} </h2>
        <h2 style={{marginTop: spacer1}}> {tile.company} </h2>
    </Col>
));

class Home extends React.Component{
    render(){
        return(
            <div>
                <Container>
                    <Row>
                        <Col md={8}>
                        <h1> 
                            Hi, Iâ€™m Paridhi Khaitan! 
                            I develop websites and mobile 
                            apps. I also enjoy design!  
                        </h1>
                        </Col>
                    </Row>
                    <Row>
                        {workList}
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Home;
